(function() {
  var soundify = require('./soundify');
  var box = require('./Box');
  var invertImage = require('./invertImage');
  
  var yBounce = [0, 3, 1];
  var imageData = 'data:image/png;base64,';
  var soundData = {
    CUCCO: {
      MP3: 'data:audio/mpeg;base64,',
      OGG: 'data:audio/ogg;base64,'
    }
  };
  
  var frames = [
    { x: 0 * 15, y: 0 * 15, cx: 0.5*15, cy: 1*15-1, width: 15, height: 15, hitbox: box(0,0,15,15)},
    { x: 1 * 15, y: 0 * 15+1, cx: 0.5*15, cy: 1*15-1, width: 15, height: 14, hitbox: box(0,0,15,14)},
    { x: 0 * 15, y: 1 * 15, cx: 0.5*15, cy: 1*15-1, width: 15, height: 15, hitbox: box(0,0,15,15)},
    { x: 1 * 15, y: 1 * 15+1, cx: 0.5*15, cy: 1*15-1, width: 15, height: 14, hitbox: box(0,0,15,14)},
    //inverted
    { x: 0 * 15, y: 2 * 15, cx: 0.5*15, cy: 1*15-1, width: 15, height: 15, hitbox: box(0,0,15,15)},
    { x: 1 * 15, y: 2 * 15+1, cx: 0.5*15, cy: 1*15-1, width: 15, height: 14, hitbox: box(0,0,15,14)},
    { x: 0 * 15, y: 3 * 15, cx: 0.5*15, cy: 1*15-1, width: 15, height: 15, hitbox: box(0,0,15,15)},
    { x: 1 * 15, y: 3 * 15+1, cx: 0.5*15, cy: 1*15-1, width: 15, height: 14, hitbox: box(0,0,15,14)},
  ];
  var animationsNormal = {
    LEFT: {
      STAND: [frames[0]],
      WALK: [frames[0], frames[1]]
    },
    RIGHT: {
      STAND: [frames[2]],
      WALK: [frames[2], frames[3]]
    }
  };
  var animationsInverted = {
    LEFT: {
      STAND: [frames[4]],
      WALK: [frames[4], frames[5]]
    },
    RIGHT: {
      STAND: [frames[6]],
      WALK: [frames[6], frames[7]]
    }
  };
  var sounds = soundify(soundData);
  
  function Cucco(x, y) {
    this.x = x;
    this.y = y;
  
    this.hitCountdown = 3; 
    this.frameIndex = 0;
    this.bounceIndex = 0;
    this.direction = 'LEFT'; //or RIGHT
    this.state = 'HAPPY'; //or FEAR, HELP
    this.animation = 'STAND'; //or WALK
    this.destination = null;
    this.lastTime = new Date().getTime();
    this.invincible = false;
    
    this.image = document.createElement('img');
    this.image.src = imageData;
    this.canvas = document.createElement('canvas');
    this.canvas.width = 15;
    this.canvas.height = 20;
    this.canvas.style.position = "absolute";
    this.context = this.canvas.getContext('2d');
    document.body.appendChild(this.canvas);
    
    this.render();
  }
  Cucco.prototype = {
    getFrame: function() {
      var animations = this.invincible ? animationsInverted : animationsNormal;
      return animations[this.direction][this.animation][this.frameIndex];
    },
    getHitBox: function(x, y) {
      x = typeof(x) === 'number' ? x : this.x;
      y = typeof(y) === 'number' ? y : this.y;
      var frame = this.getFrame();
      var hitBox = frame.hitbox;
      return box(x-frame.cx+hitBox.x, y-frame.cy+hitBox.y, hitBox.width, hitBox.height);
    },
    render: function() {
      this.canvas.style.left = Math.floor(this.x-this.canvas.width/2)+'px';
      this.canvas.style.top = Math.floor(this.y-this.canvas.height)+'px';
      var frame = this.getFrame();
      var bounce = this.animation === 'WALK' && this.state === 'HAPPY' ? yBounce[this.bounceIndex] : 0;
      var offsetX = Math.floor(this.canvas.width/2)-frame.cx;
      var offsetY = this.canvas.height-frame.cy-bounce;
      this.context.clearRect(0, 0, this.canvas.width, this.canvas.height);
      if(bounce > 0) {
        var radius = 5;
        this.context.translate(7, this.canvas.height-radius/2);
        this.context.scale(1, 0.5);
        this.context.beginPath();
        this.context.fillStyle = 'rgba(0,0,0,0.5)';
        this.context.arc(0, 0, radius, 0, 2*Math.PI, false);
        this.context.fill();
        this.context.setTransform(1, 0, 0, 1, 0, 0);
      }
      this.context.drawImage(this.image, 
        frame.x, frame.y, frame.width, frame.height, 
        offsetX, offsetY, frame.width, frame.height);
    },
    walkTo: function(x, y) {
      this.animation = 'WALK';
      this.destination = [x, y];
    },
    tick: function(collisionNet) {
      var animations = this.invincible ? animationsInverted : animationsNormal;
      this.bounceIndex = (this.bounceIndex + 1) % yBounce.length;
      this.frameIndex = (this.frameIndex + 1) % animations[this.direction][this.animation].length;
      
      var speed = this.state === 'HAPPY' ? 20 : 40;
      var time = new Date().getTime();
      var deltaSeconds = (time - this.lastTime)/1000;
      this.lastTime = time;
      if(this.destination !== null) {
        var v = [
          this.destination[0] - this.x,
          this.destination[1] - this.y,
        ];
        this.direction = v[0] <= 0 ? 'LEFT' : 'RIGHT';
        var length = Math.sqrt(Math.pow(v[0], 2)+Math.pow(v[1], 2));
        var newX, newY;
        if(length > 1) { //TODO find better heuristic
          newX = this.x + v[0] / length * deltaSeconds * speed;
          newY = this.y + v[1] / length * deltaSeconds * speed;
        } else {
          newX = this.destination[0];
          newY = this.destination[1];
          this.destination = null;
        }
        
        var collisions = collisionNet.getObjects(this.getHitBox(newX, newY));
        if(collisions.length === 0) {
          this.x = newX;
          this.y = newY;
        }
      }
      
      this.render();
    },
    remove: function() {},
    hitBySword: function() {
      var self = this;
      if(self.invincible)
        return;
      sounds.CUCCO.play();
      this.hitCountdown--;
      this.state = this.hitCountdown > 0 ? 'FEAR' : 'HELP';
      self.invincible = true;
      setTimeout(function() {
        self.invincible = false;
      }, 250);
    },
    attack: function(link) {},
  };
  module.exports = Cucco;
})();
